import { useState } from 'react';
import { Shield, ArrowRight, Users, TrendingUp, Check, Sparkles, CreditCard, ChevronDown, X } from 'lucide-react';
import { AuthModal } from '../components/auth/AuthModal';
import { DemoModal } from '../components/demo/DemoModal';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

export function LandingPage() {
  const [showAuthModal, setShowAuthModal] = useState(false);
  const [showDemo, setShowDemo] = useState(false);

  return (
    <div className="min-h-screen bg-gradient-to-br from-[#1a2942] via-[#223c63] to-[#234876]">
      {/* Modale d'authentification */}
      {showAuthModal && (
        <AuthModal onClose={() => setShowAuthModal(false)} />
      )}

      {/* Modale de démo */}
      {showDemo && (
        <DemoModal
          onClose={() => setShowDemo(false)}
          onStart={() => {
            setShowDemo(false);
            setShowAuthModal(true);
          }}
        />
      )}

      {/* Hero Section */}
      <section className="min-h-screen flex flex-col items-center justify-center px-4 py-20 relative overflow-hidden">
        {/* Logo en haut */}
        <motion.div
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="absolute top-8 left-1/2 transform -translate-x-1/2 z-10"
        >
          <svg width="64" height="64" viewBox="0 0 32 32" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M16 2L4 9V23L16 30L28 23V9L16 2Z" stroke="#C5A572" strokeWidth="2"/>
            <path d="M16 2V30" stroke="#C5A572" strokeWidth="2"/>
            <path d="M4 9L28 23" stroke="#C5A572" strokeWidth="2"/>
            <path d="M28 9L4 23" stroke="#C5A572" strokeWidth="2"/>
          </svg>
        </motion.div>

        {/* Motif géométrique et effets visuels */}
        <div className="absolute inset-0">
          <div className="absolute inset-0 opacity-5" style={{
            backgroundImage: 'radial-gradient(circle, #c5a572 1px, transparent 1px)',
            backgroundSize: '30px 30px'
          }}></div>
          <div className="absolute inset-0 bg-gradient-to-br from-[#1a2942]/95 via-[#223c63]/85 to-[#234876]/75">
            <div className="absolute inset-0 opacity-30">
              <div className="absolute top-0 left-0 w-full h-full bg-gradient-to-br from-[#c5a572]/20 via-transparent to-transparent animate-pulse"></div>
            </div>
          </div>
        </div>

        {/* Points lumineux animés */}
        <div className="absolute inset-0 overflow-hidden">
          {[...Array(20)].map((_, i) => (
            <motion.div
              key={i}
              className="absolute rounded-full bg-[#c5a572]"
              initial={{ opacity: 0, scale: 0 }}
              animate={{
                opacity: [0.3, 0.6, 0.3],
                scale: [1, 1.2, 1],
                x: [0, Math.random() * 100 - 50],
                y: [0, Math.random() * 100 - 50]
              }}
              transition={{
                duration: 3 + Math.random() * 2,
                repeat: Infinity,
                delay: Math.random() * 2
              }}
              style={{
                width: `${2 + Math.random() * 3}px`,
                height: `${2 + Math.random() * 3}px`,
                top: `${Math.random() * 100}%`,
                left: `${Math.random() * 100}%`,
                boxShadow: '0 0 10px #c5a572'
              }}
            />
          ))}
        </div>

        {/* Contenu principal */}
        <div className="max-w-6xl mx-auto text-center relative z-10">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="mb-8"
          >
            <motion.div
              initial={{ opacity: 0, scale: 0.8 }}
              animate={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.5, delay: 0.2 }}
              className="inline-flex items-center px-4 py-2 bg-[#c5a572]/10 rounded-full border border-[#c5a572]/20 mb-8"
            >
              <motion.span
                className="w-2 h-2 rounded-full bg-[#c5a572] mr-2"
                animate={{ scale: [1, 1.2, 1] }}
                transition={{ duration: 2, repeat: Infinity }}
              />
              <span className="text-[#c5a572] font-medium">Nouveau : Analyse fiscale par IA</span>
            </motion.div>

            <h1 className="text-5xl md:text-7xl font-bold text-white mb-6 leading-tight">
              Optimisez votre fiscalité avec{' '}
              <span className="relative inline-block">
                Francis
                <motion.span
                  className="absolute -bottom-2 left-0 w-full h-1 bg-gradient-to-r from-[#c5a572] to-[#e8cfa0] rounded-full"
                  initial={{ scaleX: 0 }}
                  animate={{ scaleX: 1 }}
                  transition={{ duration: 0.5, delay: 0.5 }}
                />
              </span>
            </h1>

            <p className="text-xl md:text-2xl text-gray-300 mb-12 max-w-3xl mx-auto leading-relaxed">
              Votre assistant fiscal intelligent qui vous aide à{' '}
              <span className="text-[#c5a572] font-semibold">optimiser vos impôts</span> et à prendre les meilleures décisions financières.
            </p>
          </motion.div>

          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            className="flex flex-col sm:flex-row gap-4 justify-center mb-16"
          >
            <motion.button
              onClick={() => setShowAuthModal(true)}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="px-8 py-4 bg-gradient-to-r from-[#c5a572] to-[#e8cfa0] text-[#1a2942] font-bold rounded-xl hover:shadow-lg hover:shadow-[#c5a572]/20 transition-all transform flex items-center justify-center gap-2"
            >
              <CreditCard className="w-5 h-5" />
              Commencer gratuitement
              <ArrowRight className="w-5 h-5" />
            </motion.button>

            <motion.button
              whileHover={{ scale: 1.05 }}
              onClick={() => setShowDemo(true)}
              className="px-8 py-4 bg-white/10 text-white font-bold rounded-xl hover:bg-white/20 transition-all transform flex items-center justify-center gap-2"
            >
              Voir la démo
              <ArrowRight className="w-5 h-5" />
            </motion.button>
          </motion.div>

          {/* Trust badges */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
            className="flex flex-wrap justify-center gap-6 opacity-70 mb-16"
          >
            <motion.div
              whileHover={{ scale: 1.05 }}
              className="px-4 py-2 bg-white/5 rounded-lg backdrop-blur-sm border border-white/10 flex items-center"
            >
              <Shield className="h-4 w-4 text-[#c5a572] mr-2" />
              <span className="text-sm text-gray-300">100% Sécurisé</span>
            </motion.div>
            <motion.div
              whileHover={{ scale: 1.05 }}
              className="px-4 py-2 bg-white/5 rounded-lg backdrop-blur-sm border border-white/10 flex items-center"
            >
              <Users className="h-4 w-4 text-[#c5a572] mr-2" />
              <span className="text-sm text-gray-300">+1000 Utilisateurs</span>
            </motion.div>
            <motion.div
              whileHover={{ scale: 1.05 }}
              className="px-4 py-2 bg-white/5 rounded-lg backdrop-blur-sm border border-white/10 flex items-center"
            >
              <Sparkles className="h-4 w-4 text-[#c5a572] mr-2" />
              <span className="text-sm text-gray-300">IA de pointe</span>
            </motion.div>
          </motion.div>
        </div>
      </section>

      {/* Section Avantages */}
      <section className="py-20 px-4">
        <div className="max-w-6xl mx-auto">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.8 }}
            className="text-center mb-16"
          >
            <h2 className="text-4xl font-bold text-white mb-6">
              Pourquoi choisir Francis ?
            </h2>
            <p className="text-xl text-gray-300 max-w-3xl mx-auto">
              Une solution complète pour gérer vos finances et optimiser votre fiscalité
            </p>
          </motion.div>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            <motion.div
              initial={{ opacity: 0, x: -20 }}
              whileInView={{ opacity: 1, x: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8 }}
              className="bg-white/5 backdrop-blur-sm rounded-2xl p-8 border border-[#c5a572]/20"
            >
              <div className="flex items-start gap-4">
                <div className="w-12 h-12 bg-[#c5a572]/20 rounded-xl flex items-center justify-center flex-shrink-0">
                  <Sparkles className="w-6 h-6 text-[#c5a572]" />
                </div>
                <div>
                  <h3 className="text-xl font-bold text-white mb-2">Intelligence Artificielle</h3>
                  <p className="text-gray-300">
                    Notre IA analyse vos données financières pour vous proposer les meilleures stratégies d'optimisation fiscale.
                  </p>
                </div>
              </div>
            </motion.div>

            <motion.div
              initial={{ opacity: 0, x: 20 }}
              whileInView={{ opacity: 1, x: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8 }}
              className="bg-white/5 backdrop-blur-sm rounded-2xl p-8 border border-[#c5a572]/20"
            >
              <div className="flex items-start gap-4">
                <div className="w-12 h-12 bg-[#c5a572]/20 rounded-xl flex items-center justify-center flex-shrink-0">
                  <Users className="w-6 h-6 text-[#c5a572]" />
                </div>
                <div>
                  <h3 className="text-xl font-bold text-white mb-2">Personnalisation</h3>
                  <p className="text-gray-300">
                    Des recommandations adaptées à votre situation personnelle et professionnelle.
                  </p>
                </div>
              </div>
            </motion.div>
          </div>
        </div>
      </section>

      {/* Section Tarifs */}
      <section className="py-20 px-4">
        <div className="max-w-6xl mx-auto">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.8 }}
            className="text-center mb-16"
          >
            <h2 className="text-4xl font-bold text-white mb-6">
              Une offre unique, des résultats concrets
            </h2>
            <p className="text-xl text-gray-300 max-w-3xl mx-auto">
              Accédez à toutes les fonctionnalités pour optimiser votre fiscalité
            </p>
          </motion.div>

          <div className="max-w-2xl mx-auto">
            <motion.div
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.8 }}
              className="bg-gradient-to-br from-[#c5a572]/20 to-[#e8cfa0]/20 backdrop-blur-sm rounded-2xl p-8 border border-[#c5a572]/40"
            >
              <h3 className="text-2xl font-bold text-white mb-8 text-center">Francis</h3>

              <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-8">
                {/* Option Mensuelle */}
                <div className="bg-white/5 rounded-xl p-6 border border-white/10">
                  <div className="text-center mb-4">
                    <p className="text-3xl font-bold text-[#c5a572]">9,99€</p>
                    <p className="text-gray-300">par mois</p>
                  </div>
                  <button
                    onClick={() => setShowAuthModal(true)}
                    className="w-full px-6 py-3 bg-white/10 text-white font-bold rounded-xl hover:bg-white/20 transition-all"
                  >
                    Choisir mensuel
                  </button>
                </div>

                {/* Option Annuelle */}
                <div className="bg-[#c5a572]/10 rounded-xl p-6 border border-[#c5a572]/20 relative">
                  <div className="absolute -top-3 left-1/2 transform -translate-x-1/2 bg-[#c5a572] text-[#1a2942] px-3 py-1 rounded-full text-sm font-bold">
                    Économisez 17%
                  </div>
                  <div className="text-center mb-4">
                    <div className="flex items-center justify-center gap-2">
                      <p className="text-3xl font-bold text-[#c5a572]">99,99€</p>
                    </div>
                    <p className="text-gray-300">par an</p>
                    <p className="text-sm text-gray-400 line-through mt-1">119,88€</p>
                  </div>
                  <button
                    onClick={() => setShowAuthModal(true)}
                    className="w-full px-6 py-3 bg-gradient-to-r from-[#c5a572] to-[#e8cfa0] text-[#1a2942] font-bold rounded-xl hover:shadow-lg hover:shadow-[#c5a572]/20 transition-all"
                  >
                    Choisir annuel
                  </button>
                </div>
              </div>

              <ul className="space-y-4">
                <li className="flex items-center text-gray-300">
                  <Check className="w-5 h-5 text-[#c5a572] mr-2" />
                  Analyse complète de vos transactions
                </li>
                <li className="flex items-center text-gray-300">
                  <Check className="w-5 h-5 text-[#c5a572] mr-2" />
                  Détection automatique des optimisations
                </li>
                <li className="flex items-center text-gray-300">
                  <Check className="w-5 h-5 text-[#c5a572] mr-2" />
                  Recommandations personnalisées
                </li>
                <li className="flex items-center text-gray-300">
                  <Check className="w-5 h-5 text-[#c5a572] mr-2" />
                  Support prioritaire
                </li>
                <li className="flex items-center text-gray-300">
                  <Check className="w-5 h-5 text-[#c5a572] mr-2" />
                  Mises à jour régulières
                </li>
              </ul>
            </motion.div>
          </div>
        </div>
      </section>

      {/* Section CTA */}
      <section className="py-20 px-4">
        <div className="max-w-4xl mx-auto text-center">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            transition={{ duration: 0.8 }}
            className="bg-gradient-to-br from-[#1a2942] to-[#234876] rounded-2xl p-12 border border-[#c5a572]/20"
          >
            <h2 className="text-4xl font-bold text-white mb-6">
              Prêt à optimiser votre fiscalité ?
            </h2>
            <p className="text-xl text-gray-300 mb-8 max-w-2xl mx-auto">
              Rejoignez des milliers d'utilisateurs qui font confiance à Francis pour leurs finances.
            </p>
            <button
              onClick={() => setShowAuthModal(true)}
              className="px-8 py-4 bg-gradient-to-r from-[#c5a572] to-[#e8cfa0] text-[#1a2942] font-bold rounded-xl hover:shadow-lg hover:shadow-[#c5a572]/20 transition-all transform hover:scale-105"
            >
              Commencer gratuitement
            </button>
          </motion.div>
        </div>
      </section>
    </div>
  );
}
